CREATE TABLE pharmacy(
   placeUrl      VARCHAR(257) NOT NULL PRIMARY KEY
  ,title         VARCHAR(79) NOT NULL
  ,rating        NUMERIC(3,1)
  ,reviewCount   INTEGER 
  ,category      VARCHAR(37)
  ,attributes    VARCHAR(30)
  ,address       VARCHAR(80)
  ,plusCode      VARCHAR(34)
  ,website       VARCHAR(174)
  ,phoneNumber   VARCHAR(17)
  ,星期二           VARCHAR(24)
  ,星期三           VARCHAR(24)
  ,星期四           VARCHAR(24)
  ,星期五           VARCHAR(24)
  ,星期六           VARCHAR(11)
  ,星期日           VARCHAR(11)
  ,星期一           VARCHAR(24)
  ,currentStatus VARCHAR(4)
  ,imgUrl        VARCHAR(162)
  ,isClaimed     VARCHAR(5) NOT NULL
  ,query         VARCHAR(90) NOT NULL
  ,timestamp     VARCHAR(24) NOT NULL
  ,latitude      NUMERIC(18,15)
  ,longitude     NUMERIC(21,17)
  ,info          VARCHAR(11)
);
